var FormInputMask = function ()
{
    var a = function () {
        $("#num_tel_1").inputmask({mask: "9", repeat: 15, greedy: !1});
        $("#num_tel_2").inputmask({mask: "9", repeat: 15, greedy: !1});
        $("#num_tel_3").inputmask({mask: "9", repeat: 15, greedy: !1});
        $("#anno1").inputmask({mask: "9", repeat: 4, greedy: !1});
        $("#piva1").inputmask({mask: "9", repeat: 11, greedy: !1});
        $("#email1").inputmask({mask: "*{1,20}[.*{1,20}][.*{1,20}][.*{1,20}]@*{1,20}[.*{2,6}][.*{1,2}]",
            greedy: false,
            onBeforePaste: function (pastedValue, opts) {
                pastedValue = pastedValue.toLowerCase();
                return pastedValue.replace("mailto:", "");
            },
            definitions: {
                '*': {
                    validator: "[0-9A-Za-z!#$%&'*+/=?^_`{|}~\-]",
                    cardinality: 1,
                    casing: "lower"
                }
            }});
    };
    return{init: function () {
            a();
        }};
}();
App.isAngularJsApp() === !1 && jQuery(document).ready(function () {
    FormInputMask.init();
});